import React , {useState} from 'react';
import axios from 'axios';

export default function SignUp() {
  const [form, setForm] = useState({
    id: 7,
    name: '',
    email: '',
    username: '',
    password: ''
  });

  const register = (id, name,email, username, password) => async (dispatch) => {
    try {
      const response = await axios.post('/api/register', { id, name, username, password, email });
      // Handle the response from the server, such as updating user authentication state.
      // Dispatch appropriate actions based on success or failure.
      console.log(response);
    } catch (error) {
      // Handle login error, e.g., dispatch an error action.
    }
  }

  const { id,email,name, username, password } = form;

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  }

  const handleSubmit = (e) => {
    setForm({ ...form, id: form.id + 1 });
    e.preventDefault();
    register(id, name,email, username, password);
    console.log({id, name,email, username, password})
    setForm({
      ...form,
      name: '',
      email: '',
      username: '',
      password: ''
    })
  }

  return (
    <div>
      <section className="vh-100" style={{ backgroundColor: "#eee" }}>
        <div className="container h-100">
          <div className="row d-flex justify-content-center align-items-center h-100">
            <div className="col-lg-12 col-xl-11">
              <div className="card text-black" style={{ borderRadius: "25px" }}>
                <div className="card-body p-md-5">
                  <div className="row justify-content-center">
                    <div className="col-md-10 col-lg-6 col-xl-5 order-2 order-lg-1">
                    <h3 className="fw-normal mb-3 pb-3" style={{ letterSpacing: "1px" }}>Sign Up</h3>
                      <form className="mx-1 mx-md-4" onSubmit={handleSubmit}>
                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-user fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input type="text" name='name' value={name} onChange={handleChange} id="form3Example1c" className="form-control" />
                            <label className="form-label" htmlFor="form3Example1c">Your Name</label>
                          </div>
                        </div>
                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-envelope fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input type="email" name='email' value={email} onChange={handleChange} id="form3Example3c" className="form-control" />
                            <label className="form-label" htmlFor="form3Example3c">Your Email</label>
                          </div>
                        </div>
                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-lock fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input type="password" name='password' value={password} onChange={handleChange}  id="form3Example4c" className="form-control" />
                            <label className="form-label" htmlFor="form3Example4c">Password</label>
                          </div>
                        </div>
                        <div className="d-flex flex-row align-items-center mb-4">
                          <i className="fas fa-key fa-lg me-3 fa-fw"></i>
                          <div className="form-outline flex-fill mb-0">
                            <input type="username" name='username' value={username} onChange={handleChange}  id="form3Example4cd" className="form-control" />
                            <label className="form-label" htmlFor="form3Example4cd">Username</label>
                          </div>
                        </div>
                        <div className="form-check d-flex justify-content-center mb-5">
                          <input className="form-check-input me-2" type="checkbox" value="" id="form2Example3c" />
                          <label className="form-check-label" htmlFor="form2Example3c">
                            I agree all statements in <a href="#!">Terms of service</a>
                          </label>
                        </div>
                        <div className="d-flex justify-content-center mx-4 mb-3 mb-lg-4">
                          <button type='submit' className="btn btn-info btn-lg btn-block" style={{ backgroundColor: 'purple', color: 'white' }}>Register</button>
                        </div>
                      </form>
                    </div>
                    <div className="col-md-10 col-lg-6 col-xl-7 d-flex align-items-center order-1 order-lg-2 signUp-bg">
                      {/* <img
                        src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-registration/draw1.webp"
                        className="img-fluid"
                        alt="Sample image"
                      /> */}
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}
